  false,\n\t\"url\": null,\n\t\"notes\": \"This document is two letters discussing
  the issues of retrival of USFWS bison genetic sampoles from Texas A&M University.
  The first letter is to the principal investigator (James N. Deer) at Texas A&M University
  explaining the problems the U.S. Fish and Wildlife Service has had regarding obtaining
  contracted data and the return of unconsumed bison genetics samples taken from the
  Service's herds for the Department of the Interior bison genetics study.  The second
  letter is from TAMU Associate Director to USGS explaining actions taken by TAMU
  to return the samples and missing data.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
